import React, { Fragment } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import AwesomeSlider from 'react-awesome-slider';
import './styles.scss';
import './App.css';

const App = () => {
  return (
    <AwesomeSlider>
      <div>1</div>
      <div>2</div>
      <div>3</div>
      <div>4</div>
    </AwesomeSlider>
  );
}

export default App;
